import { navigation } from "../../constants";

export const Header = () => {
  return (
    <header className="header">
      <p>LOGO</p>
      <nav>
        <ul>
          {navigation.map((item, index) => (
            <li key={index}>
              <a href="/">{item.title}</a>
            </li>
          ))}
        </ul>
      </nav>
    </header>
  );
};
